        private static int  GetMedian(List<int> list)
        {
            list.Sort();
            if(list.Count %2 != 0)
            {
                return list[list.Count() / 2];
            }
            else
            {
                int i = list.Count() / 2;
                return list[i - 1] + list[i] / 2;
            }
            return 0;
        }
