        public static int divisibleSumPairs(int n, int k, List<int> ar)
        {
            int count = 0;
            for (int i = 0; i < n - 1; i++)
            {
                for (int j = i +1; j < n; j++)
                {
                    int sum = ar[i] + ar[j];
                    if ((i < j) && (sum % k == 0))
                    {
                        count++;
                    }
                }
            }
            return count;
        }
