        public static bool isLeap(int year)
        {
            if (year >= 1919 && year <= 2700)
            {
                if (year % 400 == 0) return true;
                if (year % 4 == 0 && year % 100 != 0) return true;

            }
            else if (year >= 1700 && year <= 1917)
            {
                if (year % 4 == 0) return true;
            }
            else if (year == 1918)
            {
                if (year % 4 == 0) return true;
            }
            return false;
        }
        public static string dayOfProgrammer(int year)
        {
            int daysInLeap = 0;
            if (year == 1918)
            {
                //14 day become 1 hence go back by 13 day hecne add more 13 dasy
                daysInLeap = isLeap(year) ? 29 : 28;
                daysInLeap -= 13;
            }
            else
            {
                daysInLeap = isLeap(year) ? 29 : 28;
            }
            int daysWithoutLeal = 31 + daysInLeap + 31 + 30 + 31 + 30 + 31 + 31;

            int date = 256 - (daysWithoutLeal);
            return $"{date}.09.{year}";
        }
        public static int beautifulDays(int i, int j, int k)
        {
            int count = 0;
            for (int m = i; m <= j; m++)
            {
                int n, reverse = 0, rem;
                n = m;
                while (n != 0)
                {
                    rem = n % 10;
                    reverse = reverse * 10 + rem;
                    n /= 10;
                }
                if ((m - reverse) % k == 0)
                {
                    count++;
                }
            }
            return count;
        }
        public static int saveThePrisoner(int n, int m, int s)
        {
            int start = s;
            for (int i = 1, j = start;i <= m; i++,j++)
            {
                if (i == m)
                {
                    return j;
                }

                if (j == n) { j = 0; }
            }

            return 0;
        }
        public static List<int> circularArrayRotation3(List<int> a, int k, List<int> queries)
        {
            List<int> list = new List<int>();
            List<int> reverse = new List<int>();
            while (k > 0)
            {
                reverse.Add(a[a.Count - 1]);
                for (int i = 0; i < a.Count; i++)
                {
                    if (i > 0)
                    {
                        reverse.Add(a[i - 1]);
                    }
                }
                a   = reverse.ToList();
                reverse.Clear();
                k--;
            }

            foreach (var m in queries)
            {
                list.Add(a[m]);
            }
            return list;
        }
        public static T[] ShiftRight<T>(T[] arr, int shifts)
        {
            Array.Copy(arr, 0, arr, shifts, arr.Length - shifts);
            Array.Clear(arr, 0, shifts);
            return arr;
        }
        public static List<int> circularArrayRotation(List<int> a, int k, List<int> queries)
        {
            List<int> list = new List<int>();
            int aSize = a.Count;
            if(aSize != k)
            {
                var effectiveRotations = k % a.Count;
                List<int> list2 = a.ToList();

                list2 = list2.Take(aSize - effectiveRotations).ToList();
                List<int> sL = a.Skip(aSize - effectiveRotations).ToList();
                List<int> list3   = sL.Concat(list2).ToList();

                foreach (var m in queries)
                {
                    list.Add(list3[m]);
                }
                return list;
            }
            foreach (var m in queries)
            {
                list.Add(a[m]);
            }
            return list;
        }
