        public static int maximumToys(List<int> prices, int k)
        {
            prices.Sort();
            int sum = 0;
            int count = 0;
            foreach (int a in prices)
            {
                sum += a;
                if (sum >= k)
                {
                    break;
                }
                count++;
            }
            return count;
        }

