                int result = -x.Score.CompareTo(y.Score);
                return result == 0 ? x.Name.CompareTo(y.Name) : result;
            }
        }
        public class Record
        {
            public string Name { get; set; }
            public int Score { get; set; }
        }

        
    }
}
